import React from "react";
import {
  AppBar,
  Button,
  Card,
  CardContent,
  Grid,
  Hidden,
  Toolbar,
  Typography,
  Avatar,
  Box,
} from "@material-ui/core";
import badal1 from "../images/badal1.png";
import badal2 from "../images/badal2.png";
import badal3 from "../images/badal3.png";
import badal4 from "../images/badal4.png";
import badal5 from "../images/badal5.png";
import badal6 from "../images/badal6.png";
import ComingSoon from "./comingsoon";
import Header from "./Header";
import Navbar from "./Navbar";
import { IconButton } from "@mui/material";
import { makeStyles } from "@mui/styles";
import { blueGrey } from "@mui/material/colors";
import EastIcon from "@mui/icons-material/East";
import interRegular from "../static/Inter-Regular.ttf";
import interBold from "../static/Inter-Bold.ttf";
import interExtraBold from "../static/Inter-ExtraBold.ttf";
import { createTheme, ThemeProvider } from "@material-ui/core/styles";
import { Link } from "react-router-dom";
const useStyles = makeStyles((theme) => ({
  circle: {
    backgroundColor: blueGrey[50],
    borderRadius: "50%",
    height: 40,
    width: 40,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    position: "relative",
  },
  box: {
    display: "flex",
    flexDirection: "row",
  },
  "@font-face": {
    fontFamily: "Inter",
    src: `
      url(${interRegular}) format('truetype'),
      url(${interBold}) format('truetype'),
      url(${interExtraBold}) format('truetype')
    `,
    fontWeight: "normal",
    fontStyle: "normal",
  },
  circle1: {
    backgroundColor: blueGrey[50],
    borderRadius: "50%",
    height: 40,
    width: 40,
    display: "flex",
    justifyContent: "center",
    alignItems: "center",
    position: "relative",
    top: "9.3rem",
    left: "32rem",
  },
}));
function HomepageScreen10() {
  const theme = createTheme({
    typography: {
      caption: {
        fontSize: "0.75rem",
      },
      h5: {
        fontSize: "calc(25/16*1rem)",
      },
      h1: {
        fontSize: "calc(61.04/16*1rem)",
      },
      h2: {
        fontSize: "calc(48.83/16*1rem)",
      },
      h3: {
        fontSize: "calc(39.06/16*1rem)",
      },
      h4: {
        fontSize: "calc(31.25/16*1rem)",
      },
      body1: {
        fontSize: "calc(16/16*1rem)",
      },
    },
    spacing: (factor) => `${0.8 * factor}rem`,
  });
  const classes = useStyles();
  return (
    <>
      <ThemeProvider theme={theme}>
        <Grid
        id="explore"
          container
          spacing={1}
          style={{
            justifyContent: "space-between",
            alignItems: "center",
            margin: "auto",
            position: "relative",
            maxWidth: "83.75rem",
          }}
        >
          <Grid
            item
            style={{
              maxWidth: "100%",
              marginTop: "4.375rem",
              padding: 0,

              marginBottom: 0,
            }}
          >
            <Grid item style={{ position: "relative" }}>
              <Typography variant="caption" style={{ fontFamily: "Inter" }}>
                EXPLORE
              </Typography>
            </Grid>
            <Grid
              container
              justifyContent="space-between"
              alignItems="center"
              style={{ marginBottom: "0rem", width: "83.75rem", padding: 0 }}
            >
              <Grid item style={{ maxWidth: "39.375rem", padding: 0 }}>
                <Typography
                  variant="h1"
                  style={{
                    fontFamily: "Inter",
                    fontWeight: 800,
                    color: "#292D32",
                  }}
                >
                  Your bank of ideas.
                </Typography>
              </Grid>
            </Grid>
          </Grid>

          <Grid
            container
            spacing={{ xs: 2, md: 3 }}
            columns={{ xs: 4, sm: 8, md: 12 }}
          >
            <Grid item xs={2} sm={4} md={4}>
              <img
                src={badal6}
                style={{
                  width: "26rem",
                  height: "15rem",
                  display: "flex",
                  position: "relative",
                  left: "3.75rem",
                  top: "1.875rem",
                }}
              />
              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "7.2rem",
                  maxWidth: "20rem",
                  left: "7rem",
                  color: "white",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                Pollinate, a startup using tiny insect-bots that replicate
                natural pollination patterns.
              </Typography>
            </Grid>

            <Grid item xs={2} sm={4} md={4}>
              <img
                src={badal1}
                style={{
                  width: "22rem",
                  height: "15rem",
                  display: "flex",
                  position: "relative",
                  bottom: "3rem",
                  left: "6.8rem",
                }}
              />
              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "12rem",
                  maxWidth: "16rem",
                  left: "10rem",
                  color: "white",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                Alina is an AI designer who offers advice and ideas sustainable
                practices.
              </Typography>
            </Grid>

            <Grid item xs={2} sm={4} md={4}>
              <img
                src={badal5}
                style={{
                  width: "23rem",
                  height: "15rem",
                  diplay: "flex",
                  position: "relative",
                  left: "0.938rem",
                  top: "4rem",
                }}
              />
              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "6.3rem",
                  maxWidth: "11rem",
                  left: "7rem",
                  color: "white",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                An AI trained on the U.S. Constitution of rights. What’s your
                AI?
              </Typography>
            </Grid>

            <Grid item xs={2} sm={4} md={4}>
              <img
                src={badal4}
                style={{
                  width: "26rem",
                  height: "15rem",
                  display: "flex",
                  position: "relative",
                  top: "2rem",
                  left: "3rem",
                }}
              />
              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "8.25rem",
                  maxWidth: "15rem",
                  left: "8.5rem",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                Solein, a protein-rich food spun out of thin air using a
                fermentation process.
              </Typography>
            </Grid>

            <Grid item xs={3} sm={4} md={4}>
              <img
                src={badal2}
                style={{
                  width: "28rem",
                  height: "18rem",
                  display: "flex",
                  position: "relative",
                  bottom: "8rem",
                  left: "0.5rem",
                }}
              />

              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "19.7rem",
                  maxWidth: "17rem",
                  left: "6.5rem",
                  color: "white",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                Worldcoin, a global currency for universal basic income.
              </Typography>
            </Grid>

            <Grid item xs={1} sm={4} md={4}>
              <img
                src={badal3}
                style={{
                  width: "28rem",
                  height: "16rem",
                  display: "flex",
                  position: "relative",
                  top: "-2rem",
                  right: "0.5rem",
                }}
              />

              <Typography
                variant="body1"
                style={{
                  display: "flex",
                  position: "relative",
                  bottom: "10rem",
                  maxWidth: "15rem",
                  left: "5.5rem",
                  color: "black",
                  fontFamily:"Inter",
                  textAlign:"center"
                }}
              >
                “Sports League” Don’t bet, make an investment. A stock market,
                for sports.
              </Typography>
              <Link style={{
                display:"flex",
                position:"relative",
                bottom:"6rem",
                left:"19.8rem",
                color:"black",
                fontFamily:"Inter",
                fontWeight:"500"
              }}
              to={"/comingsoon"}
              >Read More</Link><EastIcon style={{
                display:"flex",
                position:"relative",
                bottom:"7.35rem",
                left:"25rem"
              }}/>
            </Grid>
          </Grid>

          {/*<Grid
            container
            style={{
              display: "flex",
              flexDirection: "row",
              width: "100%",
              marginTop: "3.125rem",
              justifyContent: "space-between",
              marginBottom: "4.375rem",
            }}
          >
            <Grid
              item
              style={{
                width: "48.88059701%",
                display: "flex",
                flexDirection: "column",
              }}
            >
              <Card
                style={{
